import { createRouter, createWebHashHistory } from 'vue-router'
import HomeView from '../views/HomeView.vue'

const LOGIN = () => import(/* webpackChunkName: "chunk" webpackPrefetch: true */ '../views/LoginView.vue')
const SIGNUP = () => import(/* webpackChunkName: "chunk" webpackPrefetch: true */ '../views/SignupView.vue')
const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/login',
    name: 'login',
    component: LOGIN
  },
  {
    path: '/signup',
    name: 'signup',
    component: SIGNUP
  }
]

const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
